import {Link} from 'react-router-dom';

function Header() {

    return (
      <div className="header">
        <h1>Flaming flaming hot!</h1>
        <p>Welcome!</p>
        <nav>
          This is where all the links go
          <h1><Link to="/">Home</Link></h1>
          <h1><Link to="/clothing">Clothing</Link></h1>
          <h1><Link to="/Random">Have some random fun!</Link></h1>
          <h1><Link to="/Miscellaneous">Miscellaneous</Link></h1>
          <h1><Link to="/jewelry">Jewelry</Link></h1>
          <h1><Link to="/productslist">All Products</Link></h1>
        </nav>

      </div>
    );
  }

  export default Header;
